import { useEffect, useState } from "react";

function Posts({ stories }) {

    console.log(stories)

    const mappedStories = stories.map(story => {
        return (
            <div style={{width: '65%'}} className="text-end">
                <h3 className="text-center" key={story.id}>{story.content}</h3>
                <br></br>

            </div>
        )
    })

    return (
        <div>
            {mappedStories}
        </div>
    );
}

export default Posts;
